import React from "react";
import "./homepage.css"
import { Navigate, useNavigate } from "react-router-dom";

const Homepage = () => {
   
    return (
       <div className="homepage">
        <h1>Hello homepage</h1>
        <div className="button" onClick={()=>avigate("/")}> Logout</div>
       </div>
    )
}
export default Homepage;
